INSERT INTO `product` VALUES (1,1,'Активний','Телевізор LG 49NANO86','<p>LG 49NANO86 - технологічний 4К-телевізор з NanoCell-панеллю, просунутої звукової та ігровий функціональністю. Модель являє собою 15,5-кілограмову конструкцію на основі 49-дюймового NanoCell екрану дозволом 3840x2160 пікселів з локальним затемненням, графічним чіпом e7 Gen3 4K Processor, підтримкою Dolby Vision IQ, Filmmaker Mode, а також ігровий технології AMD FreeSync. При цьому на звуковому озброєнні LG 49NANO86 складаються 10-ватні стереодинаміки з підтримкою технології Dolby Atmos, комунікаційні можливості позначені інтерфейсами Ethernet, Wi-Fi, DLNA, WiDi, Miracast, AirPlay, Bluetooth. За зручність повсякденної експлуатації відповідає операційна система webOS 5.0 з функціями Штучного Інтелекту Amazon Alexa і Google Assistant.</p>','2021-09-20 12:48:35','2021-10-31 18:12:37',16999,'слово','опис',NULL,'',NULL,NULL),(3,1,'Активний','Телевізор LG 43UP7500','<p>&nbsp; &nbsp; &nbsp;LG 43UP7500 - бюджетний 4К-телевізор компактного розміру, орієнтований на ігрове і різнобічний мультимедійне застосування. До ігровому потенціалу відносяться оптимізатор ігор HGiG і низька затримка введення, образотворчий же потенціал покликаний розкрити кінематографічний режим FILMMAKER MODE. Дисплей моделі представлений 43-дюймовим LCD-дисплеєм з LED-підсвіткою, розрішенням 3840x2160 пікселів, чотирьохядерним процесором, підтримкою AI Brightness Control і Active HDR. Чорний 8-кілограмовий корпус LG 43UP7500 оснащений цифровими тюнерами стандартів DVB-T2, DVB-S2, DVB-C, а також двома 10-ватними динаміками з підтримкою AI Sound і Ultra Surround.</p>','2021-10-06 22:46:12','2022-03-13 21:01:20',11499,'Телевізор LG 43UP7500 купити з польщі європи дешево','Телевізор LG 43UP7500','note','',NULL,NULL),(4,1,'Активний','Телевізор LG 43NANO75','<p>LG 43NANO75 - <strong>високопродуктивний</strong> 4К-телевізор в компактному виконанні, покликаний задовольнити потребу в технологічному вирішенні найменшого розміру. Основою образотворчої технологічності є 43-дюймова NanoCell-панель дозволом 3840x2160 пікселів з кінематографічним режимом, ігровим режимом з ALLM і eARC, а також підтримкою HDR Dolby Vision. Звуковий потенціал LG 43NANO75 окреслено 10-ватними стереодинаміками з підтримкою Ultra Surround і можливості синхронізації з опциональнимі бездротовими динаміками. Комунікаційна сумісність моделі віддана на відкуп бездротових інтерфейсів Bluetooth, AirPlay, Miracast, WiDi, DLNA, Wi-Fi.</p>','2021-10-07 20:58:35','2021-10-16 17:25:58',14599,'Телевізор LG 43NANO75 купити','LG 43NANO75',NULL,'',NULL,NULL),(5,1,'Активний','Телевізор LG 50NANO86','LG 50NANO86 - невеликий NanoCell-телевізор з просунутими ігровими можливостями, адресований вимогливим сучасним користувачам Smart TV. Обличчям моделі служить 50-дюймова NanoCell-панель дозволом 3840x2160 пікселів з підтримкою HDR Dolby Vision IQ, кінематографічного режиму FILMMAKER MODE, графічного процесора α7 і інтелектуальної технології AI Picture. Для геймерів LG 50NANO86 надає режим Game Optimizer, апаратну синхронізацію AMD FreeSync Premium і комплекс актуальних технологій VRR, ALLM, eARC, реалізованих на основі інтерфейсу HDMI 2.1.','2021-10-07 21:15:22','2021-10-15 21:11:59',21799,'Телевізор LG 50NANO86','Телевізор LG 50NANO86',NULL,'',NULL,NULL),(6,1,'Активний','Телевізор LG 55NANO86','LG 50NANO86 - невеликий NanoCell-телевізор з просунутими ігровими можливостями, адресований вимогливим сучасним користувачам Smart TV. Обличчям моделі служить 50-дюймова NanoCell-панель дозволом 3840x2160 пікселів з підтримкою HDR Dolby Vision IQ, кінематографічного режиму FILMMAKER MODE, графічного процесора α7 і інтелектуальної технології AI Picture. Для геймерів LG 50NANO86 надає режим Game Optimizer, апаратну синхронізацію AMD FreeSync Premium і комплекс актуальних технологій VRR, ALLM, eARC, реалізованих на основі інтерфейсу HDMI 2.1.','2021-10-07 21:31:06','2021-10-15 13:47:58',22499,'Телевізор 55NANO86','Телевізор 55NANO86',NULL,'',NULL,NULL),(7,1,'Активний','Телевізор Philips 58PUS8535','<p>Огляд Телевізор Philips 58PUS8535 Чари Ambilight. Тільки від Philips З Philips Ambilight кожен момент стає ближче. Інтелектуальні світлодіоди по краях телевізора реагують на те, що відбувається на екрані і змінюють колір для ще більшого ефекту занурення. Спробувавши один раз, ви більше не зможете від цього відмовитися. Dolby Vision і Dolby Atmos. Кінематографічні зображення і звук Підтримка форматів Dolby для звуку і відео преміум-класу означає, що HDR-матеріали будуть виглядати і звучати максимально реалістично. Як матеріали Blu-Ray, так і новий епізод серіалу, доступного за передплатою, постануть перед вами з максимальною контрастністю і яскравістю, а також реалістичною передачею кольору. І все це буде супроводжуватися об&#39;ємним, чітким і глибоким звуком. Android TV. Інтелектуально і просто Надайте телефону свій телевізор з Philips Android TV. Якщо на цьому тижні ви хочете подивитися контент на Amazon і YouTube, а на наступній - Rakuten TV і Netflix, це рішення саме для вас. Чіткий і зрозумілий інтерфейс дозволяє розташовувати джерела контенту так, як зручно вам. Легко продовжуйте перегляд розпочатих епізодів і знайомтеся з анонсами нових фільмів. Процесор Philips P5: чудову якість з будь-якого джерела Процесор Philips P5 передає контент з якістю, як на джерелі. Насолоджуйтесь великою кількістю деталей, глибиною зображення, яскравістю кольорів і природністю відтінків шкіри. Неймовірна чіткість і контрастність допоможе відчути все, що відбувається на екрані. Рух на екрані ідеально плавне. Телевізор Philips 4K UHD. Яскрава картинка HDR Ваш телевізор Philips 4K UHD сумісний з усіма основними форматами HDR, включаючи HDR10 + і Dolby Vision. Як тільки почнете дивитися популярний серіал або запустіть нову гру, ви зрозумієте, що тіні стали глибше, а в світлих ділянках зображення стало більше деталей. Кольори стануть більш реалістичними. Управління голосом. Вбудований Google Асистент. Сумісно з Alexa Керуйте телевізором з Android TV за допомогою голосових команд. Хочете зіграти в гру, подивитися Netflix або знайти контент і додатки в магазині Google Play? Просто скажіть про це своєму телевізорі. Ви навіть можете управляти всіма пристроями, сумісними з Помічником Google, наприклад приглушати світло і переводити термостат в нічний режим. І все це - не встаючи з дивана. Дні, коли ви шукали пульт від телевізора по всьому будинку, вже далеко позаду. Тепер за допомогою голосових команди ви можете управляти телевізором Philips за допомогою пристроїв з підтримкою Alexa, таких як Amazon Echo. Вмикайте телевізор, перемикайтеся між каналами або джерелами сигналу і багато іншого за допомогою Alexa. DTS Play-Fi. Мультірум-аудіосистема З DTS Play-Fi на телевізорі Philips ви можете підключатися до сумісних АС в будь-якій кімнаті. На кухні стоїть бездротова аудіосистема? Продовжуйте слухати діалоги фільму, поки готуєте перекус, і не пропускайте важливі моменти спортивної трансляції, наливаючи друзям напої. Підтримка HDR10 +. Зображення в точній відповідності з задумкою режисера Ваш телевізор Philips здатний вичавити максимум з відеоформату HDR10 +. Контрастність, колір і яскравість налаштовуються в покадровому режіме.Неважно, що ви дивитеся, - популярний серіал або новий блокбастер - ви обов&#39;язково оціните глибокі тіні. Яскраві поверхні стануть ще яскравіше, а кольори - ще реалістичніше.</p>','2021-10-15 13:59:42','2023-06-19 13:26:34',19999,'Телевізор Philips 58PUS8535','Телевізор Philips 58PUS8535',NULL,'PUS8535',NULL,NULL),(8,1,'Активний','Телевізор LG 50UP8100','Огляд Телевізор LG 50UP8100\r\nРеальний 4K UHD. нереальне занурення\r\nТелевізори LG UHD перевершують всі ваші очікування. Насолоджуйтесь живим зображенням і реалістичною передачею кольору завдяки точності пікселів, в чотири рази вище ніж в Full HD.\r\n\r\nLG втілили в життя режисерське бачення\r\nРежим FILMMAKER MODE відключає згладжування руху, зберігаючи при цьому вихідне співвідношення сторін, кольору і частоту кадрів. Цей режим дозволяє точно передати оригінальне бачення режисера, тому ви бачите фільм саме таким, яким він був задуманий.\r\n\r\nВисока якість в найдрібніших деталях\r\nUHD-телевізор LG з функцією Active HDR забезпечує точність деталей і передачі кольору. Насолоджуйтесь улюбленими фільмами в оригінальній якості завдяки кільком HDR-форматам, включаючи HDR10 і HLG.\r\n\r\nСтати непереможним\r\nПориньте в дію Game Optimizer і точна настройка HDR-графіки і відсутність затримок забезпечать швидкість і ефект повного занурення в ігровий процес.\r\n\r\nШвидка і проста настройка гри\r\nКеруйте всіма параметрами, використовуючи режими, оптимізовані для різних ігрових жанрів: FPS, RPG і RTS. Контроль контрасту зі стабілізацією чорного і білого кольору для найкращої видимості.\r\n\r\nНеймовірні відчуття від перегляду спортивних подій\r\nВідчуйте себе на стадіоні. Технологія Bluetooth Surround Ready дарує відчуття присутності на змаганнях. А завдяки повідомленнями про спортивні змагання ви завжди будете знати, коли грає ваша улюблена команда.\r\n\r\nВи ніколи не пропустите гру улюбленої команди\r\nПовідомлення надходять до вас до початку, під час і після ігор. Ви ніколи не пропустите важливі гри улюблених команд, навіть якщо дивіться щось інше.\r\n\r\nПоліпшуйте якість всього проглядається контенту\r\nПроцесор усуває шум у відео, створює більш живі кольори і підсилює контрастність. Зображення з низьким дозволом масштабируются і відтворюються заново, наближаючись до якості 4К.\r\n\r\nВи думаєте, що знаєте, що таке смарт-технології? Настав час дізнатися про це знову\r\nLG ThinQ створений для того, щоб ви отримували від телевізора максимум задоволення. Ви можете вибрати улюблену технологію голосового помічника, використовувати голосове управління і новий головний екран, який забезпечує ще більшу зручність і контроль.','2021-10-15 21:39:45','2021-10-15 21:39:45',16499,'Телевізор LG 50UP8100','Телевізор LG 50UP8100',NULL,'',NULL,NULL),(9,1,'Активний','Телевізор LG 50NANO80','<h2 class=\"text-title\" style=\"margin: 0px 0px 10px; padding: 0px; font-family: \'Open Sans\', Arial, \'Helvetica CY\', \'Nimbus Sans L\', sans-serif; box-sizing: border-box; appearance: none; font-size: 24px; color: #333333; font-weight: 300; line-height: 34px; text-align: center;\">Огляд&nbsp;Телевізор LG 49NANO806NA</h2>\r\n<div style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none; color: #000000; font-size: medium;\">\r\n<div class=\"text-block\" style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none; max-height: 100%;\">\r\n<p style=\"margin: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; box-sizing: border-box; appearance: none;\">&nbsp; &nbsp; &nbsp;NanoCell LED-телевізор LG 49NANO806NA &ndash; інноваційний сучасний гаджет, який дозволить поглянути на світ телебачення та процес споживання відеоконтенту абсолютно по-новому. Потужний процесор, мультифункціональність, легке управління, вражаючі якість зображення та звуку &ndash; все переверне ваше уявлення про домашнє ТБ.</p>\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none;\">&nbsp;</p>\r\n</div>\r\n</div>\r\n<h3 style=\"margin: 0px; padding: 0px; font-family: \'Open Sans\', Arial, \'Helvetica CY\', \'Nimbus Sans L\', sans-serif; box-sizing: border-box; appearance: none; text-align: center;\">Телевізор LG 49NANO806NA: короткий огляд та характеристики</h3>\r\n<p>&nbsp;</p>\r\n<div style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none; color: #000000; font-size: medium;\">\r\n<div class=\"text-block\" style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none; max-height: 100%;\">\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none;\">&nbsp; &nbsp; &nbsp;Перший телевізор NanoCell південнокорейською компанією LG був випущений у 2017 році. Головна особливість пристрою &ndash; нанесення найдрібніших наночастинок на поверхню екрану. Вони поглинають світлові хвилі надлишкової довжини, роблячи зображення максимально яскравим та чистим, мінімізують відблиски від оточуючих джерел світла та автоматично калібрують точність і стабільність кольору.</p>\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none;\">&nbsp;</p>\r\n</div>\r\n</div>\r\n<h1 style=\"margin: 0px; padding: 0px; font-family: \'Open Sans\', Arial, \'Helvetica CY\', \'Nimbus Sans L\', sans-serif; box-sizing: border-box; appearance: none; text-align: center;\">Дизайн телевізора</h1>\r\n<p>&nbsp;</p>\r\n<div style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none; color: #000000; font-size: medium;\">\r\n<div class=\"text-block\" style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none; max-height: 100%;\">\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none;\">&nbsp; &nbsp; &nbsp;Телевізор LG 49NANO806NA гармонійно виглядає в кімнатах із будь-яким інтер\'єром за рахунок витонченого стриманого зовнішнього оформлення. Чорний корпус із невеликими рамками стане відмінним доповненням просторої вітальні або спальні.</p>\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none;\">Розміри моделі складають 109,6х64х6,3 см, а вага &ndash; 14,2 кг. Завдяки компактним габаритам та витонченим ніжкам телевізор можна встановити на тумбі або полиці. Для настінного монтажу передбачено кріплення стандарту VESA 200х200 мм.</p>\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none;\">&nbsp;</p>\r\n<figure style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none; text-align: center;\"><img class=\"img-async loaded\" style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none; max-width: 100%; max-height: 100%;\" src=\"https://stylus.ua/thumbs/640x358/14/12/1964446.jpeg\" alt=\"image alt\" data-src=\"/thumbs/640x358/14/12/1964446.jpeg\" data-was-processed=\"true\" /></figure>\r\n<h1 style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none;\">&nbsp;</h1>\r\n</div>\r\n</div>\r\n<h1 style=\"margin: 0px; padding: 0px; font-family: \'Open Sans\', Arial, \'Helvetica CY\', \'Nimbus Sans L\', sans-serif; box-sizing: border-box; appearance: none; text-align: center;\">Параметри та особливості екрану</h1>\r\n<p>&nbsp;</p>\r\n<div style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none; color: #000000; font-size: medium;\">\r\n<div class=\"text-block\" style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none; max-height: 100%;\">\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none;\">&nbsp; &nbsp; &nbsp;Діагональ телевізора LG 49NANO806NA становить 49 дюймів, а частота оновлення &ndash; 50 Гц. Апарат відображає картинку в форматі 4К (3840x2160 точок) із кутом огляду 178/178&deg;.</p>\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none;\">&nbsp;</p>\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none;\">&nbsp; &nbsp; &nbsp;Щоб отримати чітке, яскраве, насичене зображення з реалістичною передачею кольору, в телевізорі задіяли такі технології:</p>\r\n<ul style=\"list-style-type: disc;\">\r\n<li>Motion Pro &ndash; для деталізації в супердинамічних спортивних сценах без розмиття зображення.</li>\r\n<li>Nano Accuracy &ndash; для точної передачі кольору під будь-яким кутом огляду. При цьому спотворення картинки відсутні.</li>\r\n<li>VRR &ndash; для бездоганної гри без зависань, переривань кадру та мерехтіння.</li>\r\n<li>HDR 10 Pro &amp; HLG Pro &ndash; вдосконалені технології для передачі зображення відмінної якості.</li>\r\n<li>Filmmaker Mode &ndash; для нейтралізації шуму, відключення інтерполяції кадрів та збереження первісного співвідношення сторін.</li>\r\n<li>Dolby Vision IQ &ndash; для автоматичного налаштування насиченості, яскравості та контрастності згідно рівня освітлення та жанру контенту.</li>\r\n<li>Nano Black &ndash; для насиченого чорного, повного затемнення, контролю підсвічування.</li>\r\n</ul>\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none;\">&nbsp;</p>\r\n<figure style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none;\"><img class=\"img-async loaded\" style=\"margin: 0px auto; padding: 0px; box-sizing: border-box; appearance: none; max-width: 100%; max-height: 100%; display: block;\" src=\"https://stylus.ua/thumbs/640x358/9c/18/1964447.jpeg\" alt=\"image alt\" data-src=\"/thumbs/640x358/9c/18/1964447.jpeg\" data-was-processed=\"true\" /></figure>\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none;\">&nbsp;</p>\r\n</div>\r\n</div>\r\n<h1 style=\"margin: 0px; padding: 0px; font-family: \'Open Sans\', Arial, \'Helvetica CY\', \'Nimbus Sans L\', sans-serif; box-sizing: border-box; appearance: none; text-align: center;\">Особливості аудіосистеми</h1>\r\n<p>&nbsp;</p>\r\n<div style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none; color: #000000; font-size: medium;\">\r\n<div class=\"text-block\" style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none; max-height: 100%;\">\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none;\">&nbsp; &nbsp; &nbsp;За звук у телевізорі LG 49NANO806NA відповідають вбудовані динаміки потужністю 20 Вт. Потужне, об\'ємне, кристально чисте звучання навіть на високій гучності забезпечується віртуальними аудіоканалами та технологією Ultra Surround. Щоб посилити звукові ефекти, користувачеві пропонується підключити зовнішні колонки за допомогою Bluetooth-з\'єднання.</p>\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none;\">&nbsp;</p>\r\n</div>\r\n</div>\r\n<h1 style=\"margin: 0px; padding: 0px; font-family: \'Open Sans\', Arial, \'Helvetica CY\', \'Nimbus Sans L\', sans-serif; box-sizing: border-box; appearance: none; text-align: center;\">Комунікації та бездротові технології</h1>\r\n<p>&nbsp;</p>\r\n<div style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none; color: #000000; font-size: medium;\">\r\n<div class=\"text-block\" style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none; max-height: 100%;\">\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none;\">&nbsp; &nbsp; &nbsp;Телевізор LG 49NANO806NA виходить у мережу інтернет та з\'єднується з іншими гаджетами за допомогою таких сучасних бездротових технологій, як Bluetooth та Wi-Fi. Також у конструкції корпусу передбачені інтерфейси:</p>\r\n<ul style=\"list-style-type: disc;\">\r\n<li>4xHDMI;</li>\r\n<li>2хUSB;</li>\r\n<li>Ethernet;</li>\r\n<li>оптичний;</li>\r\n<li>компонентний + композитний;</li>\r\n<li>слот для CI.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n<h1 style=\"margin: 0px; padding: 0px; font-family: \'Open Sans\', Arial, \'Helvetica CY\', \'Nimbus Sans L\', sans-serif; box-sizing: border-box; appearance: none; text-align: center;\">Додаткові можливості та опції LG 49NANO806NA</h1>\r\n<p>&nbsp;</p>\r\n<div style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none; color: #000000; font-size: medium;\">\r\n<div class=\"text-block\" style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none; max-height: 100%;\">\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none; text-align: left;\">&nbsp; &nbsp; &nbsp;Головне завдання будь-якого телевізора &ndash; це прийом телевізійного сигналу та виведення зображення на екран. Для цього в пристрої LG 49NANO806NA передбачений цифровий тюнер форматів DVB-T, DVB-T2, DVB-C, DVB-S, DVB-S2 із функцією телетексту. Але на цьому можливості моделі не закінчуються, вони набагато більші:</p>\r\n<ul style=\"list-style-type: disc;\">\r\n<li>Вбудований медіаплеєр. Насолоджуйтесь переглядом фото- та відеофайлів, слухайте музику з максимальним комфортом, підключивши до гаджету зовнішній накопичувач через USB.</li>\r\n<li>Smart TV. Вибирайте та налаштовуйте ТВ-канали на свій розсуд, створюйте списки улюблених передач, дивіться відео в інтернеті або користуйтеся улюбленими додатками на великому екрані.</li>\r\n<li>Інтелектуальне управління LG ThinQ AI. Розпізнавання голосу, зручний Bluetooth-пульт дозволяє налаштовувати домашню систему Home IoT прямо з екрану ТВ.</li>\r\n<li>Спеціальний режим для геймерів. Висока якість зображення та звуку, плавна графіка динамічних сцен і мінімальний час затримки відгуку гарантують повноцінне занурення в сюжет гри та максимальний комфорт.</li>\r\n<li>Спортивне оповіщення. З телевізором LG 49NANO806NA ви будете в курсі всіх спортивних новин та не проґавите жодного важливого матчу.</li>\r\n</ul>\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none; text-align: center;\">&nbsp;</p>\r\n<figure style=\"margin: 0px; padding: 0px; box-sizing: border-box; appearance: none; text-align: center;\"><img class=\"img-async loaded\" style=\"margin: 0px auto; padding: 0px; box-sizing: border-box; appearance: none; max-width: 100%; max-height: 100%; display: block;\" src=\"https://stylus.ua/thumbs/640x358/2c/51/1964448.jpeg\" alt=\"image alt\" data-src=\"/thumbs/640x358/2c/51/1964448.jpeg\" data-was-processed=\"true\" /></figure>\r\n</div>\r\n</div>','2021-10-15 21:54:25','2022-03-13 21:00:11',18999,'LG 50NANO80','LG 50NANO80',NULL,'',NULL,NULL),(10,1,'Активний','Телевізор LG 50NANO81','Обзор Телевизор LG 50NANO81\r\nЧистые цвета\r\nЧистые цвета в диапазоне RGB — залог реалистичного качества изображения. В технологии NanoCell используются наночастицы, которые создают чистые цвета с помощью фильтрации неточных оттенков цветов и повышения чистоты спектра RGB.\r\n\r\nНастоящий 4K, создаваемый Чистыми Цветами\r\nТелевизор NanoCell обеспечивает качество реальных 4K, отвечающее международным стандартам КМ (контрастной модуляции). Откройте для себя более чистые визуальные ощущения с разрешением Real 4K вместе с технологией NanoCell.\r\n\r\nТеперь картинка и звук еще более реалистичные\r\nТелевизор NanoCell с четырехъядерным процессором 4K устраняет шум, обеспечивая более динамичную цветопередачу и контрастность. Картинки с низким разрешением масштабируются и восстанавливаются, становясь по качеству ближе к формату 4К.\r\n\r\nЧистые цвета превращают ваш дом в кинотеатр\r\nС телевизором NanoCell все сцены стали реалистичными благодаря живым цветам и высокой контрастности Nano Black. Кроме того, видеоряд и звуковое сопровождение стали еще более оптимизированными и настоящими. Наслаждайтесь кинотеатром у вас дома и безлимитными развлечениями вместе с телевизором NanoCell.\r\n\r\nСмотрите фильмы такими, какими их создали\r\nПроцессор автоматически отключает интерполяцию кадров, изменение резкости и шумоподавление, сохраняя оригинальное соотношение сторон и количество кадров. Смотрите фильмы и другой контент с сохранением творческого замысла и кинематографического опыта.','2021-10-15 22:19:09','2021-10-15 22:19:09',17299,'Телевізор LG 50NANO81','Телевізор LG 50NANO81',NULL,'',NULL,NULL),(11,1,'Активний','Телевізор LG 55NANO75','<p>Обзор Телевизор LG 55NANO75 8 миллионов пикселей. Потрясающее изображение. Чистые цвета в телевизорах NanoCell TV Real 4K ошеломляют. Благодаря 8 миллионам пикселей телевизор с реальным 4K позволяет получать более четкое и детализированное изображение, чем обычный HD-телевизор.</p>\r\n<p>В телевизорах NanoCell реальное 4K-разрешение дополняется технологией NanoCell, позволяющей наслаждаться изображением 4K с качеством, превосходящим международные стандарты. Кристальная чистота каждого оттенка В телевизорах LG NanoCell используется наша уникальная нанотехнология позволяющая фильтровать и улучшать качество цветопередачи, удаляя артефакты, возникающие в RGB-сигнале. Благодаря этому вы видите на экране только чистые и точные цвета. В результате вы можете наслаждаться более насыщенным и реалистичным изображением. Nano Кино.</p>\r\n<p>Картинка, достойная большого экрана Телевизоры LG NanoCell с точной цветопередачей и экранами, созданными с использованием самых современных технологий, превратят ваш дом в настоящий кинотеатр. Улучшенный режим HDR, обновленные технологии Dolby и кинематографический режим обеспечивают впечатление от просмотра, как в настоящем кинотеатре. Режим FILMMAKER MODE Режим FILMMAKER MODE отключает сглаживание движения, сохраняя при этом исходное соотношение сторон, цветопередачу и частоту кадров. Этот режим позволяет точно передать оригинальное видение режиссера, поэтому вы видите фильм именно таким, каким он был задуман. HDR 10 Pro Разработанная компанией LG технология расширения динамического диапазона HDR 10 Pro регулирует яркость, улучшает цветопередачу и раскрывает все мельчайшие детали, придавая реалистичную четкость любым изображениям и улучшая обычный HDR-контент. Теперь все ваши любимые фильмы и сериалы будут более яркими и потрясающими.</p>\r\n<p>Nano Игры. Телевизор, созданный для потрясающих впечатлений Из темных глубин к новым светлым мирам: телевизор LG NanoCell наполняет ваши игры новыми цветами и красками. Облачные игровые технологии и автоматическая коррекция качества изображения позволяют вам наслаждаться великолепным качеством картинки и дарят вам новые потрясающие впечатления от игр. Режим Game Optimizer Наслаждайтесь новым уровнем качества ваших любимых игр. Режим Game Optimizer автоматически корректирует настройки изображения и графики, позволяя вам наслаждаться вам уникальным качеством изображения независимо от типа игры. Nano Спорт. Эффективность, способная одержать победу в любом матче. Телевизоры LG NanoCell подарят вам уникальный опыт просмотра спортивных соревнований. Окружающий звук Bluetooth создаст в вашем доме атмосферу стадиона, а благодаря уведомлениям о спортивных событиях вы никогда не пропустите важные новости о любимой команде. Звук вокруг через Bluetooth Простое подключение динамиков через Bluetooth для получения настоящего беспроводного объемного звука. Все действия звучат более насыщенно и реалистично, создавая атмосферу большой игры в вашей гостиной. Новый пульт Magic Remote Пульт Magic имеет эргономичный дизайн. Пульт легко ложится в руку, а его система наведения и прокрутки обеспечивает более быстрый поиск. Встроенная технология искусственного интеллекта обеспечивает легкий доступ к сервисам, а горячие клавиши для основных платформ контента позволяют быстро переходить к избранному. Помимо этого, теперь у вас есть Magic Tap &mdash; новая смарт-функция, позволяющая подключать ваш телефон к телевизору.</p>','2021-10-15 22:24:40','2021-10-26 22:37:38',19499,'Телевізор LG 55NANO75','Телевізор LG 55NANO75',NULL,'',NULL,NULL),(12,1,'Активний','Телевізор Philips 65OLED705','<h1 class=\"text-title\" style=\"text-align: center;\"><span style=\"color: #999999;\">Огляд&nbsp;Телевізор Philips 65OLED706 / 12</span></h1>\r\n<div class=\"left-part\">\r\n<div class=\"text-block\">\r\n<h3 style=\"text-align: center;\">Той самий телевізор з чарівної підсвічуванням Ambilight. Тільки від Philips.</h3>\r\n<p style=\"text-align: left;\">&nbsp; &nbsp; &nbsp;З Philips Ambilight кожен момент стає ближче. Інтелектуальні світлодіоди по краях телевізора реагують на те, що відбувається на екрані і змінюють колір для ще більшого ефекту занурення. Спробувавши один раз, ви більше не зможете від цього відмовитися.</p>\r\n</div>\r\n</div>','2021-10-30 20:44:08','2022-03-18 21:02:02',43999,'Телевізор Philips 65OLED705','Телевізор Philips 65OLED705',NULL,'',NULL,NULL),(13,1,'Активний','Телевізор LG OLED55B1','<h1 class=\"text-title\" style=\"text-align: center;\"><span style=\"color: #000000;\">Огляд телевізора LG OLED55B1</span></h1>\r\n<h6 style=\"text-align: center;\">&nbsp;</h6>\r\n<h2 style=\"text-align: center;\"><span style=\"color: #808080;\">Технологія, яка переверне вашу свідомість</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"color: #000000;\">&nbsp; &nbsp; &nbsp;Телевізор LG&nbsp;OLED55B1 - це насолода споглядання світу. Самоподсвечівающіеся пікселі забезпечують якість зображення, дійсно вражає, і цілий ряд дизайнерських можливостей, тоді як сучасні технології гарантують безпрецедентний рівень дивного зображення.&nbsp;</span></p>\r\n<h2 style=\"text-align: center;\"><span style=\"color: #808080;\">Відчуйте весь спектр задоволень</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"color: #000000;\">&nbsp; &nbsp; &nbsp;Власна технологія розширення динамічного діапазону HDR 10 Pro забезпечує регулювання яскравості для поліпшення кольорів, розкриття кожної найменшої подробиці і надання високої чіткості кожному зображенню - все це посилює звичайний HDR контент. Тепер всі ваші улюблені фільми і шоу стануть більш реалістичними і яскравими - від початку до самого кінця.&nbsp;</span></p>\r\n<h2 style=\"text-align: center;\"><span style=\"color: #808080;\">Наповніть свій світ сяйвом</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"color: #000000;\">&nbsp; &nbsp; &nbsp;Серце кожного OLED-телевізора LG - процесор &alpha;9 4-го покоління на основі штучного інтелекту з підтримкою формату 4K, інноваційний чіп, який використовує алгоритми глибокого навчання для аналізу і оптимізування контенту. Кожен побачений на екрані елемент вражає, адже всі налаштування зображення і звуку здійснюються автоматично.&nbsp;</span></p>\r\n<h2 style=\"text-align: center;\"><span style=\"color: #808080;\">100 мільйонів причин полюбити OLED</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"color: #000000;\">&nbsp; &nbsp; &nbsp;Телевізори з OLED-технологією мають мільйони самоподсвечівающіхся пікселів, здатних відтворювати бездоганний відтінок чорного та інших кольорів.</span></p>\r\n<h2 style=\"text-align: center;\"><span style=\"color: #808080;\">Бачення режисера, втілене в життя</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"color: #000000;\">&nbsp; &nbsp; &nbsp;Режим FILMMAKER MODE &trade; відключає згладжування рухів, одночасно зберігаючи оригінальне співвідношення сторін, кольору і частоту зміни кадрів. Все це точно відтворює оригінальне бачення режисера, тобто ваші враження від перегляду фільму будуть саме такими, як передбачали його творці. Якщо ви шукаєте унікальний телевізор, то припиняйте пошуки. OLED-телевізор LG - це витвір мистецтва, кінотеатр з великим екраном, портал в світ ігор і місце в першому ряду на найбільших спортивних подіях. Це всесвіт, яким для вас може стати телевізор.<br /></span></p>\r\n<div id=\"gtx-trans\" style=\"position: absolute; left: 1222px; top: 42.9375px;\">&nbsp;</div>','2021-10-30 22:46:57','2022-03-18 21:03:01',26999,'Телевізор LG OLED55B1','Телевізор LG OLED55B1',NULL,'',NULL,NULL),(14,1,'Активний','Телевізор Samsung QE55Q67A','<h1 style=\"text-align: center;\">Огляд телевізора Samsung QE55Q67A</h1>\r\n<p>&nbsp;</p>\r\n<h2 style=\"text-align: center;\"><span style=\"color: #808080;\">Мільярд відтінків кольору завдяки технології квантових точок</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"color: #000000;\">&nbsp; &nbsp; &nbsp;Технологія квантових точок забезпечує дуже високу якість зображення. Завдяки 100% об\'єму кольору, технологія квантових точок перетворює світло на приголомшливу палітру кольору, якість кольору при цьому залишається високою при будь-якому рівні яскравості.</span></p>\r\n<h2 style=\"text-align: center;\"><span style=\"color: #808080;\">Технологія подвійного підсвічування Dual LED</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"color: #000000;\">&nbsp; &nbsp; &nbsp;Інноваційна технологія підсвічування забезпечує більш чітку і точну контрастність за рахунок оптимізації колірного тону підсвічування відповідно до типу контенту, що переглядається.</span></p>\r\n<h2 style=\"text-align: center;\"><span style=\"color: #808080;\">Технологія Quantum HDR</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"color: #000000;\">&nbsp; &nbsp; &nbsp;Технологія Quantum HDR дозволяє виявити найдрібніші деталі зображення та забезпечити оптимальну контрастність, щоб ви отримали максимальне задоволення від перегляду кожної сцени. Технологія динамічного мепінгу HDR10+, характеристики якого перевищують вимоги звичайних стандартів, дозволяє створювати більш глибокі відтінки чорного, більш чіткіше перенесення кольорів і поліпшену деталізацію.</span></p>\r\n<h2 style=\"text-align: center;\"><span style=\"color: #808080;\">Потужний інтелектуальний 4К процесор</span></h2>\r\n<p style=\"text-align: left;\">&nbsp; &nbsp; &nbsp;Потужний процесор Samsung оптимізує якість звуку в залежності від контенту, що переглядається. Завдяки технології масштабування до 4K, ви зможете дивитися улюблений контент у роздільній здатності 4К.</p>\r\n<h2 style=\"text-align: center;\"><span style=\"color: #808080;\">Технологія Object Tracking Sound Lite (OTS Lite)</span></h2>\r\n<p style=\"text-align: left;\">&nbsp; &nbsp; &nbsp;Об\'ємний 3D-звук з нашим віртуальним верхнім каналом звуку дозволить Вам повністю поринути у те, що відбувається на екнарі.</p>\r\n<h2 style=\"text-align: center;\"><span style=\"color: #808080;\">Функція Q-Symphony</span></h2>\r\n<p style=\"text-align: left;\">&nbsp; &nbsp; &nbsp;Насолоджуйтесь гармонійним звучанням телевізора та саундбару. Функція Q - Symphony унікальним чином дозволяє динамікам телевізора та саундбару працювати синхронно, забезпечуючи найкращий ефект об\'ємного звучання без відключення динаміків телевізора.</p>','2021-11-02 13:38:58','2022-03-18 21:04:04',19999,'Телевізор Samsung QE55Q67A','Телевізор Samsung QE55Q67A',NULL,'',NULL,NULL),(15,1,'Активний','Телевізор Sony XR-65X90J','<h1 style=\"text-align: center;\">Огляд телевізора Sony XR-65X90J</h1>\r\n<p>&nbsp;</p>\r\n<h2 style=\"text-align: center;\"><span style=\"color: #808080;\">Зображення XR</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"color: #000000;\">&nbsp; &nbsp; &nbsp;Насолоджуйтесь глибоким, реалістичним і красивим зображенням з будь-якого ракурсу з мінімальними відблисками. Наш революційний процесор миттєво виконує перехресний аналіз картинки аналогічно зоровому сприйняттю людини і оптимізує сотні тисяч елементів. У поєднанні з панеллю Full Array LED ця технологія забезпечує контрастне і реалістичне зображення.</span></p>\r\n<h2 style=\"text-align: center;\"><span style=\"color: #808080;\">XR Triluminos Pro &trade;</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"color: #000000;\">&nbsp; &nbsp; &nbsp;Кольори на екрані цього телевізора, оснащеного нашим когнітивним процесором XR, виходять неймовірно красивими. Кількість відтінків і їх насиченість збільшені, завдяки чому ви бачите природні тони і найменші деталі навіть в темних ділянках.</span></p>\r\n<h2 style=\"text-align: center;\"><span style=\"color: #808080;\">XR Contrast</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"color: #000000;\">&nbsp; &nbsp; &nbsp;Зачаровує контрастність. Як у реальному світі. Cognitive Processor XR проводить перехресний аналіз даних і через призму людського сприйняття покращує зображення, фокусуючись на кольорі і його насиченості. Технологія XR Contrast Booster робить світлі ділянки світлішими, а темні-темнішими, щоб забезпечити деталізацію зображення.</span></p>\r\n<h2 style=\"text-align: center;\"><span style=\"color: #808080;\">4k з частотою 120 кадрів / с</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"color: #000000;\">&nbsp; &nbsp; &nbsp;BRAVIA допоможе вам отримати перевагу перед суперниками. Завдяки інтерфейсу HDMI 2.1 частота кадрів в сумісних іграх може досягти 120 кадрів/с.Так Ви отримуєте перевагу в стрільбі, спорті та іграх, що вимагають високопродуктивної техніки і миттєвої реакції. Вам також сподобається неймовірно плавна графіка в іграх зі скороченою затримкою вхідного сигналу-менше 8,5 мс при використанні 4k з частотою 120 кадрів/с і спеціального ігрового режиму.</span></p>\r\n<h2 style=\"text-align: center;\"><span style=\"color: #808080;\">Переміщення звуку XR</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"color: #000000;\">&nbsp; &nbsp; &nbsp;Для забезпечення реалістичного звучання технологія XR Sound Position розкриває сутність звуку, прихованого за зображенням. Завдяки високочастотним динамікам телевізора BRAVIA XR Full Array LED звук повністю синхронізується із зображенням, забезпечуючи ефект повного занурення.</span></p>\r\n<h2 style=\"text-align: center;\"><span style=\"color: #808080;\">Голосовий пошук</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"color: #000000;\">&nbsp; &nbsp; &nbsp;Моментально знаходите улюблені фільми і передачі: просто скажіть, що ви хочете подивитися. Завдяки голосовому пошуку вам більше не доведеться витрачати час на пошук контенту вручну і незручний Набір тексту.</span></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>','2021-11-02 15:32:47','2022-03-18 21:05:09',38999,'Телевізор Sony XR-65X90J','Телевізор Sony XR-65X90J',NULL,'',NULL,NULL),(16,1,'Активний','Телевізор Samsung UE55AU7192','<h1 style=\"text-align: center;\">Огляд телевізора&nbsp;Samsung UE55AU7192</h1>\r\n<p>&nbsp;</p>\r\n<h2 style=\"text-align: center;\"><span style=\"color: #808080;\">Висока роздільна здатність зображення</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"color: #000000;\">&nbsp; &nbsp; &nbsp;Телевізор Samsung UE-55AU7192 має дозвіл Ultra HD (3840 x 2160), що забезпечує зображення чудової якості. За рахунок унікальної чіткості досягається реалістична і точна картинка, завдяки чому дуже чіткими будуть навіть найдрібніші деталі картинки.</span></p>\r\n<h2 style=\"text-align: center;\"><span style=\"color: #808080;\">Дзеркальний екран</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"color: #000000;\">&nbsp; &nbsp; &nbsp;Ця технологія телевізора Samsung UE-55AU7172 надає можливість відображати одне й те саме зображення з екрану телевізора на інший пристрій. Наприклад, передачі з екрану телевізора Ви можете дивитися паралельно на Smart пристрої, перебуваючи в іншій кімнаті.</span></p>\r\n<h2 style=\"text-align: center;\"><span style=\"color: #808080;\">Технологія Micro Dimming</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"color: #000000;\">&nbsp; &nbsp; &nbsp;Технологія Micro Dimming біля телевізора Samsung UE-55AU7172 поглиблює чорний колір, а також збільшує чіткість і глибину кольорів і відтінків. Тому на екрані телевізора зелень трави буде більш насиченою, а класичні чорно-білі фільми - більш контрастними.</span></p>\r\n<h2 style=\"text-align: center;\"><span style=\"color: #808080;\">Bluetooth</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"color: #000000;\">&nbsp; &nbsp; &nbsp;Bluetooth дозволяє без проводів підключити Sound Bar або яке-небудь Smart пристрій. Ви зможете під\'єднати планшет або смартфон і переглядати збережені фотографії на екрані телевізора Samsung UE-55AU7172 або підключити бездротові навушники, щоб не заважати домочадцям звуком телевізора у вечірній час.</span></p>\r\n<h2 style=\"text-align: center;\"><span style=\"color: #808080;\">Підключення бездротових миші і клавіатури</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"color: #000000;\">&nbsp; &nbsp; &nbsp;До телевізору Samsung UE-55AU7172 можна підключити бездротову мишу і клавіатуру, таким чином використовуючи екран телевізора в якості комп\'ютерного монітора. Ви можете не тільки дивитися фільми, але і перегортати новинні портали і соціальні мережі, а також грати в ігри або просто працювати на великому екрані. Ваш телевізор відкриває Вам не тільки світ телебачення, а й цілий світ розваг</span></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>','2021-11-02 16:19:02','2022-03-18 21:06:20',14799,'Телевізор Samsung UE55AU7192','Телевізор Samsung UE55AU7192 дешево',NULL,'',NULL,NULL),(17,1,'Активний','Телевізор Philips 65PUS9206','<h1 style=\"text-align: center;\"><span style=\"color: #333333;\">Огляд телевізора&nbsp;Philips 65PUS9206</span></h1>\r\n<p><span style=\"color: #333333;\">&nbsp;</span></p>\r\n<h2 style=\"text-align: center;\"><span style=\"color: #333333;\">Повне занурення. 4-стороння підсвічування Ambilight.</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"color: #333333;\">&nbsp; &nbsp; &nbsp;З 4-стороннім підсвічуванням Philips Ambilight кожен момент стає ближче. Інтелектуальні світлодіоди по краях телевізора реагують на те, що відбувається на екрані і змінюють колір для ще більшого ефекту занурення. Спробувавши один раз, ви більше не зможете від цього відмовитися.</span></p>\r\n<h2 style=\"text-align: center;\"><span style=\"color: #333333;\">Ідеально для ігор. Низька затримка з будь-якими консолями</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"color: #333333;\">&nbsp; &nbsp; &nbsp;Ваш телевізор Philips пропонує новітнє підключення HDMI 2.1 і автоматично перемикається в режим низької затримки, коли ви запускаєте гру на консолі. Він підтримує VRR і Freesync для плавного ігрового процесу, а ігровий режим Ambilight наповнить кімнату яскравими відчуттями.</span></p>\r\n<h2 style=\"text-align: center;\"><span style=\"color: #333333;\">Чудова якість з будь-якого джерела. Процесор Philips P5.</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"color: #333333;\">&nbsp; &nbsp; &nbsp;Процесор Philips P5 передає контент з якістю, як на джерелі. Насолоджуйтесь великою кількістю деталей, глибиною зображення, яскравістю кольорів і природністю відтінків шкіри. Неймовірна чіткість і контрастність допоможе відчути все, що відбувається на екрані. Рух на екрані ідеально плавне.</span></p>\r\n<h2 style=\"text-align: center;\"><span style=\"color: #333333;\">Кінематографічне зображення і звук. Dolby Vision і Dolby Atmos</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"color: #333333;\">&nbsp; &nbsp; &nbsp;Підтримка форматів Dolby для звуку і відео преміум-класу означає, що HDR-матеріали будуть виглядати і звучати максимально реалістично. Матеріали постануть перед вами згідно із задумом режисера, і ви зможете оцінити об\'ємне, чисте і глибоке звучання.</span></p>\r\n<h2 style=\"text-align: center;\"><span style=\"color: #333333;\">Преміальний дизайн . Від підставки до пульта ДУ.</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"color: #333333;\">&nbsp; &nbsp; &nbsp;Кожна деталь цього телевізора випромінює розкіш. Підставка з полірованого металу естетично контрастує з безрамковим екраном, а м\'який і елегантний пульт ДУ зі шкіряною обробкою зручно тримати в руках і використовувати.</span></p>\r\n<h2 style=\"text-align: center;\"><span style=\"color: #333333;\">Простота і зручність. Android TV.</span></h2>\r\n<p style=\"text-align: left;\"><span style=\"color: #333333;\">&nbsp; &nbsp; &nbsp;Телевізори Philips Android TV відкривають доступ до будь-якого контенту. Можна налаштувати головний екран як Вам зручно і організувати зручний доступ до улюблених додатків, щоб дивитися фільми і телепередачі було просто. Продовжувати перегляд можна з того місця, де ви зупинилися.</span></p>\r\n<h2 style=\"text-align: center;\"><span style=\"color: #333333;\">Голосове управління . Google Асистент. Працює з Alexa</span></h2>\r\n<div class=\"left-part\">\r\n<div class=\"text-block\">\r\n<p style=\"text-align: left;\"><span style=\"color: #333333;\">&nbsp; &nbsp; &nbsp;Натисніть кнопку на пульті ДУ для спілкування з Google асистентом. Керуйте ТВ або пристроями \"Розумний будинок\", сумісними з Google асистентом, за допомогою голосових команд. Також телевізор підтримує управління через голосові команди Alexa на сумісних з Alexa пристроях.</span></p>\r\n</div>\r\n</div>\r\n<p><span style=\"color: #333333;\">&nbsp;</span></p>','2021-11-07 12:46:22','2022-03-18 21:10:07',36899,'Телевізор Philips 65PUS9206','Телевізор Philips 65PUS9206',NULL,'',NULL,NULL),(18,1,'Активний','Телевізор Samsung QLED QE55Q80A','<h1 style=\"text-align:center\">Огляд телевізора Samsung QE55Q80A</h1>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2 style=\"text-align:center\"><span style=\"color:#808080\">Покращена технологія QLED в Samsung Q80</span></h2>\r\n\r\n<p style=\"text-align:left\"><span style=\"color:#000000\">&nbsp; &nbsp; &nbsp;У 2020 році компанія Samsung з гордістю готова представити нову серію телевізорів Q80, функціональні можливості якої перевершують всі очікування. Завдяки технології 8х прямого підсвічування зображення отримує більш яскраві кольори і дійсно чорні ділянки на екрані. Об&#39;ємне звучання істотно покращує сприйняття як музичних кліпів, так і повнометражних фільмів, які ви будете дивитися на великому екрані Samsung Q80. Для найсучаснішого контенту особливо привабливо буде виглядати динамічний діапазон відтвореного зображення, за підтримки технології Quantum HDR 12х.</span></p>\r\n\r\n<h2 style=\"text-align:center\"><span style=\"color:#808080\">Вражаюча контрастність</span></h2>\r\n\r\n<p style=\"text-align:left\"><span style=\"color:#000000\">&nbsp; &nbsp; &nbsp;Завдяки технології Direct Full Array 8x в телевізорі Samsung Q80 проводиться поліпшена пряма підсвічування кожного блоку пікселів. Це дає можливість створювати більш контрастне зображення, з натуральним чорним кольором і насиченими відтінками інших кольорів.</span></p>\r\n\r\n<h2 style=\"text-align:center\"><span style=\"color:#808080\">Можливості процесора Quantum 4k в Samsung Q80</span></h2>\r\n\r\n<p style=\"text-align:left\"><span style=\"color:#000000\">&nbsp; &nbsp; &nbsp;На високій обчислювальній потужності процесора Quantum 4k грунтується більшість передових технологій, реалізованих в телевізорі Samsung Q80. Одна з них дозволяє масштабувати контент в низькій якості до рівня справжнього 4к.тут на допомогу приходить штучний інтелект, який використовує власні алгоритми роботи і домальовує відсутні пікселі і кольору в підсумковому зображенні. В результаті ви отримаєте високоякісне зображення з відмінною деталізацією і насиченими відтінками, як ніби дійсно дивіться відео в якості Ultra HD.</span></p>\r\n\r\n<h2 style=\"text-align:center\"><span style=\"color:#808080\">Адаптивна настройка дисплея</span></h2>\r\n\r\n<p style=\"text-align:left\"><span style=\"color:#000000\">&nbsp; &nbsp; &nbsp;Автоматичне налаштування рівня яскравості в телевізорі Samsung Q80, купити в Комфі який можна дуже зручно, дозволяє значно комфортніше дивитися його в будь-який час доби. Вбудований датчик освітленості реєструє зниження або збільшення інтенсивності світла навколо пристрою і відповідно регулює цей параметр на телевізорі.</span></p>\r\n\r\n<h2 style=\"text-align:center\"><span style=\"color:#808080\">Стеження за джерелом звуку в Samsung Q80</span></h2>\r\n\r\n<p style=\"text-align:left\"><span style=\"color:#000000\">&nbsp; &nbsp; &nbsp;За допомогою унікальної технології прив&#39;язки звуку до його джерела, власник телевізора Samsung Q80 зможе в точності визначати в просторі його пересування. Створюючи акустичний фокус на кожному такому об&#39;єкті акустика телевізора притягує увагу до нього і переміщує звук в просторі в міру переміщення його джерела в кадрі.</span></p>\r\n\r\n<h2 style=\"text-align:center\"><span style=\"color:#808080\">Новітній HDR</span></h2>\r\n\r\n<p style=\"text-align:left\"><span style=\"color:#000000\">&nbsp; &nbsp; &nbsp;За відтворення HDR-контенту відповідає поліпшена технологія Quntum HDR 12x. вона підтримує стандарт HDR10+ і дозволяє істотно розширювати динамічний діапазон як в темних ділянках кадру, так і в найсвітліших.</span></p>\r\n\r\n<h2 style=\"text-align:center\"><span style=\"color:#808080\">Квантові точки розширюють колірне покриття в Samsung Q80</span></h2>\r\n\r\n<p style=\"text-align:left\"><span style=\"color:#000000\">&nbsp; &nbsp; &nbsp;Технологія QLED в телевізорі Samsung Q80, купити в Києві який ви зможете швидко, істотно збільшує кількість відображуваних кольорів на його екрані і дозволяє охоплювати більше одного мільярда відтінків. Таким чином, глядач отримував найбільш реалістичне зображення, зі 100% охопленням всіх кольорів, які бачив би око людини.</span></p>\r\n\r\n<h2 style=\"text-align:center\"><span style=\"color:#808080\">Оптимізація для ігор</span></h2>\r\n\r\n<p style=\"text-align:left\"><span style=\"color:#000000\">&nbsp; &nbsp; &nbsp;Для більшості ігор екран повинен відповідати таким вимогам як висока частота оновлення зображення на екрані, мінімальна швидкість відгуку кожного пікселя і якість відображення в темних сценах. Телевізор Samsung Q80, ціна якого повністю відповідає його якості, ідеально підходить за всіма вищеописаними критеріями і на додаток пропонує підтримку технології AMD FreeSync для роботи з відеоадаптерами Radeon.</span></p>\r\n\r\n<h2 style=\"text-align:center\"><span style=\"color:#808080\">Автоматичне збільшення гучності голосу в Samsung Q80</span></h2>\r\n\r\n<p style=\"text-align:left\"><span style=\"color:#000000\">&nbsp; &nbsp; &nbsp;За допомогою технології Active Voice Amplifier відбувається автоматичний контроль гучності звуку, відповідному голосу людини. Ця система аналізує шуми за межами телевізора, наприклад, від побутової техніки і виробляє підвищення рівня гучності, пропорційно наростанню шуму. Таким чином ви завжди почуєте відбуваються діалоги в телевізорі Samsung Q80.</span></p>\r\n\r\n<h2 style=\"text-align:center\"><span style=\"color:#808080\">Повна оптимізація для роботи з саундбаром</span></h2>\r\n\r\n<p style=\"text-align:left\"><span style=\"color:#000000\">&nbsp; &nbsp; &nbsp;Нова лінійка телевізорів Samsung Q80 має технологію Q-symphony і здатна найкращим чином використовувати можливості саундбара по відтворенню звуку. На окрему увагу заслуговує процес синхронізації між вбудованими в телевізор динаміками і підключеним саундбаром. Ці випромінювачі працюють повністю синхронно і можуть взаємодоповнювати один одного, створюючи більш широке і об&#39;ємне звукове поле.</span></p>\r\n\r\n<h2 style=\"text-align:center\"><span style=\"color:#808080\">Відсутність рамок в телевізорі Samsung Q80</span></h2>\r\n\r\n<p style=\"text-align:left\"><span style=\"color:#000000\">&nbsp; &nbsp; &nbsp;Отримуйте тільки найяскравіші емоції від перегляду телевізора Samsung Q80. Його дизайн передбачає відсутність рамок навколо екрану і, тому, глядач зможе цілком зануритися в те, що відбувається, навіть забуваючи, що він дивиться телевізор.</span></p>\r\n\r\n<h2 style=\"text-align:center\"><span style=\"color:#808080\">Доповнює інтер&#39;єр, а не псує його</span></h2>\r\n\r\n<p style=\"text-align:left\"><span style=\"color:#000000\">&nbsp; &nbsp; &nbsp;Завдяки режиму роботи Ambient + телевізор Samsung Q80, купити в Україні який зручно за допомогою нашої служби доставки, може адаптуватися під ваш інтер&#39;єр в той час, поки він не використовується. У компанії Samsung подбали, щоб на вашій стіні не було чорних прямокутників, а красувався злився з інтер&#39;єром новітній QLED-девайс, що став його частиною.</span></p>\r\n\r\n<h2 style=\"text-align:center\"><span style=\"color:#808080\">Швидка робота з Tizen OS на Samsung Q80</span></h2>\r\n\r\n<p style=\"text-align:left\"><span style=\"color:#000000\">&nbsp; &nbsp; &nbsp;Фірмова платформа Smart Hub, що працює поверх операційної системи Tizen OS в телевізорі Samsung Q80, пропонує користувачеві один з кращих варіантів Smart TV на ринку. Тут і швидка робота всіх додатків, і повнофункціональний Сучасний пульт дистанційного керування і, звичайно ж, можливість голосових команд, значно спрощує використання пристрою. З такими технологічними рішеннями використання телевізора здасться вам казково простим і зручним.</span></p>','2021-11-10 18:36:11','2023-06-15 23:03:21',24499,'Телевізор Samsung QLED QE55Q80A','Телевізор Samsung QLED QE55Q80A',NULL,'Q80A',NULL,NULL);
